history.value:
color:black; 
background-color: lightgrey;
font: Helvetica Neue,Helvetica,Arial,sans-serif;
width: 10em;
font-size: 200%; 
border: thick ridge green;
text-align: center;
border-radius: 3mm;

let props = this.properties
if (!props.elapsed) {
  props.elapsed = 0
  props.dots = ""
}

props.elapsed += e.deltaTime
if (props.elapsed > 1000) {
  props.elapsed = 1
  props.dots = props.dots + "." 
  if (props.dots.length > 4) {
     props.dots = ""
  }
} 

return  e.graphTarget.text + "<p>." + props.dots + "</p>"

